import React from 'react';
import './App.css'; // Make sure this line imports your CSS file correctly

function App() {
  return (
    <div className="App">
      {/* This div creates the red bar on the left */}
      <div className="left-red-bar"></div>

      {/* This div will contain all your main application content */}
      <div className="main-content">
        <h1>My To-Do List</h1>
        {/*
          In a real To-Do app, your task input, task list,
          and other components would go here.
          For now, this is just a placeholder.
        */}
        <p>This is where your To-Do list content will appear.</p>
        <input type="text" placeholder="Add a new task..." />
        <button>Add Task</button>
      </div>
    </div>
  );
}

export default App;
